import React from 'react';

class Counter extends React.Component {
  constructor(props) {
    super(props);
    this.state = {
      toggle: false,
    };
  }
  handleShowHide = () => {
    this.setState({
      toggle: !this.state.toggle,
    });
  };

  render() {
    return (<div>
       <div></div>
      {this.state.toggle ? <h1>Trung</h1> : null}
      
      
      </div>);
  }
}

export default Counter;
